import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import './AddAirplaneForm.css';       // reuse the same CSS card/grid

export default function AddPersonForm() {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    personID:   '',
    firstName:  '',
    lastName:   '',     // optional
    locationID: '',
    taxID:      '',
    experience: '',
    miles:      '',     // optional
    funds:      ''      // optional
  });
  const [msg, setMsg] = useState('');

  const handleChange = e => {
    const { name, value } = e.target;
    setForm(f => ({ ...f, [name]: value }));
  };

  const handleSubmit = async e => {
    e.preventDefault();
    const nullify = v => (v.trim() === '' || v.toUpperCase() === 'NULL') ? null : v;

    const submission = {
      personID:   form.personID,
      firstName:  form.firstName,
      lastName:   nullify(form.lastName),
      locationID: form.locationID,
      taxID:      form.taxID,
      experience: parseInt(form.experience, 10),
      miles:      form.miles  === '' ? null : parseInt(form.miles, 10),
      funds:      form.funds === '' ? null : parseFloat(form.funds)
    };

    try {
      await axios.post('/api/persons', submission);
      setMsg('✅ Person added!');
      // optionally navigate somewhere: navigate('/view‑people');
    } catch (err) {
      setMsg(err.response?.data?.error || 'Error adding person');
    }
  };

  return (
    <form className="form-container" onSubmit={handleSubmit}>
      <h2>add_person()</h2>
      <div className="form-grid">

        <div className="form-group">
          <label>Person ID:</label>
          <input name="personID" value={form.personID} onChange={handleChange} required/>
        </div>

        <div className="form-group">
          <label>First Name:</label>
          <input name="firstName" value={form.firstName} onChange={handleChange} required/>
        </div>

        <div className="form-group">
          <label>Last Name (optional):</label>
          <input name="lastName" value={form.lastName} onChange={handleChange}/>
        </div>

        <div className="form-group">
          <label>Location ID:</label>
          <input name="locationID" value={form.locationID} onChange={handleChange} required/>
        </div>

        <div className="form-group">
          <label>Tax ID:</label>
          <input name="taxID" value={form.taxID} onChange={handleChange} required/>
        </div>

        <div className="form-group">
          <label>Experience (legs):</label>
          <input
            name="experience"
            type="number"
            value={form.experience}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label>Miles (optional):</label>
          <input
            name="miles"
            type="number"
            value={form.miles}
            onChange={handleChange}
            placeholder="Leave blank or NULL"
          />
        </div>

        <div className="form-group">
          <label>Funds (optional):</label>
          <input
            name="funds"
            type="number"
            step="0.01"
            value={form.funds}
            onChange={handleChange}
            placeholder="Leave blank or NULL"
          />
        </div>

      </div>

      <div className="form-actions">
        <button type="submit">Add</button>
      </div>

      {msg && <p className="message">{msg}</p>}
    </form>
  );
}
